import React from 'react'
import { connect } from 'react-redux'
import { bindActionCreators } from 'redux'

import { initScene } from '../reducer/webscene/actions';

interface ViewProps {
  username: string,
  userItems: []
}

export class UserItemsView extends React.Component <ViewProps, { }> {
  componentDidMount() {
    if (this.props.username) {
      this.props.init(this.itemView, this.props.username)
      console.log("hey")
    }
  }

  constructor(props: any) {
    super(props);
    this.state = {
    }
  }

  public static defaultProps = {
    username: undefined,
    userItems: [],
  }

  itemView: any;

  render() {
    return (
      <div className="useritemsview" ref={(ref) => { this.itemView = ref }}/>
    )
  }
}

const mapStateToProps = ({ user: { username, userItems }}:any) => ({
  username,
  userItems,
})

function mapDispatchToProps(dispatch: any) {
  return {
    init: bindActionCreators(initScene, dispatch),
  }
}

export default connect(mapStateToProps, mapDispatchToProps)(UserItemsView)
